Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty of Counts 1 and 2 as charged in the Amended Information and ordered a Judgment of Conviction be entered into the record.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Mr. Thomas W.  The Court imposed the following:

AS TO COUNT 01:
The Court imposed 9 months at the House of Correction, with Huber for work; good time allowed; credit for one (1) day time served. Court STAYED said sentence and placed defendant on probation for two (2) years.

AS TO COUNT 02:
The Court imposed 9 months at the House of Correction, consecutive to Count 1, with Huber for work; good time allowed.  Court STAYED said sentence and placed defendant on probation for two (2) years, concurrent to Count 1.

CONDITIONS OF PROBATION:
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for defendant's physical or mental well-being; take as prescribed and only for as long as deemed medically reasonable and necessary;
 - AODA assessment and treatment and/or aftercare;
 - Urine screens;
 - No contact with Serena B. or Able Luebke Overhead Doors, 4170 South Howell Avenue, Milwaukee, Wisconsin;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay restitution to West Bend Mutual Insurance (subrogated party) in the stipulated amount of $5,000, plus the restitution to the victims, to be determined at a later date.  Court also ordered defendant to pay DNA surcharges, costs and disbursements.  Failure to pay would result in a civil judgment entered against defendant.

Court ordred case adjourned for restitution hearing before Branch 20 on 7/20/15 at 8:30 a.m.

Filed,
Notice of Right to Seek Postconviction Relief;
Pretrial Incarceration Credit form;
Letter from West Bend Mutual Insurance Company;
Two letters in support of defendant.
